    .then((elem) => JSON.stringify(elem))}
  return (
    <div>
      {fetch("https://api.github.com/users/facebook/repos")
        .then((elem) => elem.map((elem) => elem))
        .then((elem) => JSON.stringify(elem))}
    </div>
  );
}
